import axios from 'axios';


export class FormService {

    //Отправить форму на телеграмм
    static async sendFormToTelegram(formData) {
        const responce = await axios.post(`https://api.telegram.org/bot5886546930:AAFbwo3GQkztX6WhgqJjwbtl8GRy1GvTFP8`, formData)
        return responce 
    }
}
